    "2016-07-27T22:42:02.680851",nt"name": "environmental-quality-assessment-of-the-iroquois-national-wildlife-refuge-alabama-new-1988",nt"isopen":
    false,nt"url": null,nt"notes": "The U.S. Fish and Wildlife Service conducted
    a 3-year monitoring program at the Iroquois National Wildlife Refuge, Alabama, New
    York to identify any contaminant problems that could potentially affect the health
    and wellbeing of a breeding pair of bald eagles (Haliaeetus leucocephalus), an endangered
    species, that have produced a pair of fledglings annually for the past 4 years.
    Samples of sediments, snapping turtle (Chelydra serpentina) tissues, wood duck (Aix
    sponsa) and hooded merganser (Lophodytes cacullatus) eggs, and fish were collected
    at various locations on the refuge and two contiguous New York State Wildlife Management
    Areas. All samples were analyzed for chlorinated hydrocarbon compounds and heavy
    metals/trace elements. All hydrocarbon compounds tested for were either not detected
    or were measured at levels that do not pose an apparent threat to the eagles. The
    levels of inorganic elements in sediments exhibited considerable variation, as expected,
    but no serious elevations were apparent. Inorganic levels in the various tissue
    matrices were virtually all below levels of concern. Based on the results obtained,
    it is concluded that no significant threat to the eagles from environmental contaminants
    exists at this time. A recommendation has been made that samples of fish, the primary
    food of the eagles, be periodically collected and analyzed for contaminants of concern.
    This study was completed by the New York Field Office, U.S. Fish and Wildlife Service,
    Cortland, New York with the funding and assistance of the Division of Refuges and
